//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

contract Student {
    struct Vote {
        address voter;
        uint256 candidateId;
        uint256 voteId;
    }

    mapping(address => bool) public voters;
    mapping(uint256 => Vote) public votes;
    uint256 public voteCount;

    event VoteCast(address indexed voter, uint256 indexed candidateId, uint256 indexed voteId);

    constructor() {
        voteCount = 1; // Initialize vote count to 1
    }

    function vote(uint256 candidateId, uint256 voteId) public {
        require(!voters[msg.sender], "You have already voted.");
        voters[msg.sender] = true;
        votes[voteCount] = Vote(msg.sender, candidateId, voteId);
        emit VoteCast(msg.sender, candidateId, voteId);
        voteCount++; // Increment vote count after storing the vote
    }

    function getVote(uint256 index) public view returns (address, uint256, uint256) {
        require(index < voteCount, "Invalid vote index.");
        // Retrieve the vote based on the provided index
        Vote memory _vote = votes[index];
        return (_vote.voter, _vote.candidateId, _vote.voteId);
    }
}
